import React from 'react';

const Mapfunction = () => {
  const Data = [
    {
      id: 1,
      name: 'Ankit',
    },
    {
      id: 2,
      name: 'Ritik',
    },
    {
      id: 3,
      name: 'Anshu',
    },
  ];
  return <div />;
};

export default Mapfunction;
